import React, { Component } from "react";
import SingleNews from "./SingleNews";
class News extends Component {
  RenderItems = () => {
    return this.props.items.map((item) => (
      <SingleNews item={item} key={item.id} />
    ));
  };
  state = {};
  render() {
    return (
      <ul>
        <li>{this.RenderItems}</li>
      </ul>
    );
  }
}

export default News;
